[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?drugName ?targetName ?mechanismType ?chemblId
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?mechanism a cco:Mechanism ;
             cco:mechanismActionType ?mechanismType ;
             cco:hasMolecule ?molecule ;
             cco:hasTarget ?target .
  ?molecule a cco:SmallMolecule ;
            rdfs:label ?drugName ;
            cco:chemblId ?chemblId ;
            cco:highestDevelopmentPhase 4 .
  ?target a cco:SingleProtein ;
          rdfs:label ?targetName ;
          cco:organismName "Homo sapiens" .
  ?targetName bif:contains "'kinase'" option (score ?sc)
}
ORDER BY DESC(?sc) ?drugName
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?drugName ?chemblId (COUNT(DISTINCT ?target) as ?targetCount) (GROUP_CONCAT(DISTINCT ?mechanismType; separator="; ") as ?mechanisms)
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?mechanism a cco:Mechanism ;
             cco:mechanismActionType ?mechanismType ;
             cco:hasMolecule ?molecule ;
             cco:hasTarget ?target .
  ?molecule a cco:SmallMolecule ;
            rdfs:label ?drugName ;
            cco:chemblId ?chemblId ;
            cco:highestDevelopmentPhase 4 .
  ?target a cco:SingleProtein ;
          rdfs:label ?targetName ;
          cco:organismName "Homo sapiens" .
  ?targetName bif:contains "'kinase'" option (score ?sc)
}
GROUP BY ?drugName ?chemblId
ORDER BY DESC(?targetCount) ?drugName
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?drugName ?chemblId ?targetName ?mechanismType
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?mechanism a cco:Mechanism ;
             cco:mechanismActionType ?mechanismType ;
             cco:hasMolecule ?molecule ;
             cco:hasTarget ?target .
  ?molecule a cco:SmallMolecule ;
            rdfs:label ?drugName ;
            cco:chemblId ?chemblId ;
            cco:highestDevelopmentPhase 4 .
  ?target a cco:SingleProtein ;
          rdfs:label ?targetName ;
          cco:organismName "Homo sapiens" .
  ?targetName bif:contains "'kinase'" option (score ?sc)
  FILTER(?drugName IN ("IMATINIB MESYLATE", "SUNITINIB", "DASATINIB", "REGORAFENIB", "BOSUTINIB", "IBRUTINIB", "RUXOLITINIB PHOSPHATE", "AFATINIB DIMALEATE", "VANDETANIB"))
}
ORDER BY ?drugName ?targetName"}}]

[{"name": "mcp__ols__search", "input": {"query": "insulin signaling pathway"}}, {"name": "mcp__togomcp__search_reactome_entity", "input": {"query": "insulin signaling pathway", "rows": 10}}, {"name": "mcp__ols__fetch", "input": {"id": "go+http://purl.obolibrary.org/obo/GO_0008286"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "reactome"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?proteinName ?uniprotId ?pathwayName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?pathway a bp:Pathway ;
           bp:displayName ?pathwayName ;
           bp:organism ?org ;
           bp:pathwayComponent*/bp:left|bp:right ?protein .
  ?org bp:name "Homo sapiens" .
  ?protein a bp:Protein ;
           bp:entityReference ?proteinRef .
  ?proteinRef bp:name ?proteinName ;
              bp:xref ?xref .
  ?xref a bp:UnificationXref ;
        bp:db "UniProt"^^xsd:string ;
        bp:id ?uniprotId .
  ?pathwayName bif:contains "'insulin' AND 'signaling'" option (score ?sc)
}
ORDER BY DESC(?sc)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>

SELECT DISTINCT ?pathway ?pathwayName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?pathway a bp:Pathway ;
           bp:displayName ?pathwayName .
  ?pathwayName bif:contains "'insulin'" option (score ?sc)
}
ORDER BY DESC(?sc)
LIMIT 20"}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "insulin signaling pathway genes molecular function", "max_results": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?proteinName ?uniprotId
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?pathway a bp:Pathway ;
           bp:displayName "Insulin receptor signalling cascade" ;
           bp:pathwayComponent*/bp:left|bp:right ?entity .
  ?entity bp:entityReference ?ref .
  ?ref bp:name ?proteinName ;
       bp:xref ?xref .
  ?xref a bp:UnificationXref ;
        bp:db "UniProt"^^xsd:string ;
        bp:id ?uniprotId .
}
LIMIT 50"}}, {"name": "mcp__ols__searchClasses", "input": {"query": "insulin receptor signaling pathway", "ontologyId": "go", "pageSize": 20}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "go", "sparql_query": "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX obo: <http://purl.obolibrary.org/obo/>

SELECT DISTINCT ?gene ?geneLabel ?function
WHERE {
  ?gene rdf:type ?type ;
        rdfs:label ?geneLabel .
  ?annotation rdf:type ?annotationType ;
              ?relatesTo <http://purl.obolibrary.org/obo/GO_0008286> ;
              ?hasGene ?gene .
  OPTIONAL {
    ?gene ?hasProp ?function .
  }
}
LIMIT 50"}}, {"name": "mcp__pubmed__get_article_metadata", "input": {"pmids": ["41616222"]}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "insulin receptor", "limit": 10}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "IRS1 insulin receptor substrate", "limit": 5}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "PI3K phosphoinositide 3-kinase", "limit": 5}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pdb"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX pdbx: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>

SELECT 
  (COUNT(DISTINCT ?entry) as ?total_entries)
  (COUNT(DISTINCT ?entry_with_pubmed) as ?entries_with_pubmed)
FROM <http://rdfportal.org/dataset/pdbj>
WHERE {
  ?entry a pdbx:datablock .

  OPTIONAL {
    ?entry pdbx:has_citationCategory/pdbx:has_citation ?citation .
    ?citation pdbx:citation.pdbx_database_id_PubMed ?pubmed .
    BIND(?entry as ?entry_with_pubmed)
  }
}"}}]

[{"name": "mcp__togomcp__ncbi_list_databases", "input": {}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__togoid_getRelation", "input": {"source": "clinvar.gene", "target": "ncbigene"}}, {"name": "mcp__togomcp__togoid_getAllDataset", "input": {}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT DISTINCT ?gene_type (COUNT(?gene) as ?count)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?gene a cvo:Gene .
  OPTIONAL { ?gene a ?gene_type }
  FILTER(?gene_type != cvo:Gene)
}
GROUP BY ?gene_type
ORDER BY DESC(?count)"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?gene ?gene_id ?symbol ?full_name ?hgnc_id ?omim
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?gene a cvo:Gene ;
        cvo:gene_id ?gene_id ;
        cvo:symbol ?symbol .
  OPTIONAL { ?gene cvo:full_name ?full_name }
  OPTIONAL { ?gene cvo:hgnc_id ?hgnc_id }
  OPTIONAL { ?gene cvo:omim ?omim }
}
LIMIT 20"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT DISTINCT ?property (COUNT(?value) as ?count)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?gene a cvo:Gene .
  ?gene ?property ?value .
}
GROUP BY ?property
ORDER BY DESC(?count)
LIMIT 20"}}, {"name": "mcp__togomcp__togoid_getAllRelation", "input": {}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
PREFIX med2rdf: <http://med2rdf.org/ontology/med2rdf#>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT DISTINCT ?variant ?variant_label ?gene_uri ?gene_symbol ?gene_id
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?variant_label ;
           cvo:classified_record ?classrec .
  ?classrec sio:SIO_000628 ?gene_bn .
  ?gene_bn med2rdf:gene ?gene_uri .

  ?gene_entity a cvo:Gene ;
               cvo:gene_id ?gene_id ;
               cvo:symbol ?gene_symbol .

  FILTER(?gene_symbol = "BRCA1")
}
LIMIT 10"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

